import React from 'react';

export default function Buttoni({first, buttons, onClickHandler}) {
    return (
        <div className="bot">

            <p><img src="/img/botlog.png" alt="" width={'3%'} height={'25%'}/>{first}</p>
            {buttons.map((buttonText, index) => (
                <button
                    key={index}
                    className="button"
                    onClick={() => onClickHandler(buttonText)}
                >
                    {buttonText}
                </button>
            ))}
        </div>
    );
}
